import React, { Component } from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { Cats } from './Cats';


class App extends Component  {
	constructor() {
		this.state = {
			Cats: Cats,
			searchfield: ''
		}
	}
	render() {
		return (
		<div className='tc'>
			<h1>CatFriends</h1>
			<SearchBox />
			<CardList Cats={Cats}/>
		</div>

		);
	}

}


export default App;
